import React, {useState, useEffect} from 'react'
import Card from '../components/Card';
import axios from 'axios';

const data = {
    "listings": [
      {
        "id": 56513315,
        "title": "Oceanside Villa",
        "owner": "alina@unsw.edu.au",
        "address": {},
        "thumbnail": "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAUAAAAFCAYAAACNbyblAAAAHElEQVQI12P4//8/w38GIAXDIBKE0DHxgljNBAAO9TXL0Y4OHwAAAABJRU5ErkJggg==",
        "price": 350,
        "reviews": [
          {}
        ]
      }
    ]
}

function LandingPage() {
  const [listings, setlistings] = useState([]);
  useEffect(() => {
    const fn = async() => {
      let resp = await axios.get(`http://localhost:5005/listings`);
      if(resp.status === 200){
        setlistings(resp.data.listings)
      }
    }
  }, [])


    return (
        <>
            {data.listings.map((e, i)=>{
              return(<Card key={i} thumbnail={e.thumbnail} title={e.title} price={e.price} reviews={e.reviews}/>)})}
        </>
    )
}

export default LandingPage
